import React from 'react';
import './style.css';
import Bg from './Images/intro-bg.jpg';
const header = () => {
  return (
    <div>
      <header>
        <div className="img-div">
          <img src={Bg} alt="bg" />
        </div>
      </header>
    </div>
  );
};

export default header;
